DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `a_auth_get_user`(
    in getter_user varchar(320)
)
BEGIN
    DECLARE user_id INT DEFAULT NULL;

    SELECT id INTO user_id FROM users WHERE email = getter_user OR username = getter_user LIMIT 1;

    IF user_id IS NOT NULL THEN
        IF EXISTS (SELECT 1 FROM users_org WHERE id = user_id) THEN
            SELECT a.*, b.category, b.org_name, 1 AS is_admin FROM users a LEFT JOIN users_org b ON a.id = b.id WHERE a.id = user_id;
        ELSE
            SELECT a.*, 0 AS is_admin FROM users a WHERE a.id = user_id;
        END IF;
    END IF;
END ;;
DELIMITER ;
