CREATE DEFINER=`root`@`localhost` PROCEDURE `a_events_filtered_get`(
    IN date_cursor DATE,
    IN priority_cursor INT,
    IN id_cursor INT,
    IN p_start_date DATETIME,
    IN p_end_date DATETIME,
    IN p_is_free BOOLEAN,
    IN p_is_latest BOOLEAN,
    IN p_center_lat DECIMAL(10, 8),
    IN p_center_lng DECIMAL(11, 8),
    IN p_radius INT,
    IN p_genre_ids VARCHAR(255),
    IN p_tag_ids VARCHAR(255),
    IN p_min_age INT,
    IN p_max_age INT
)
BEGIN

    SELECT 
        a.id,
        a.date AS date,
        a.title,
        b.username,
        a.location_text,
        a.free,
        a.link,
        a.image,
        a.user_id,
        c.min_age,
        c.max_age,
        a.created,
        (SELECT COUNT(id) FROM events_likes  WHERE event_id = a.id) AS likes,
        (SELECT COUNT(id) FROM events_clicks WHERE event_id = a.id) AS clicks,
        
        (SELECT GROUP_CONCAT(t.id SEPARATOR '#')
           FROM events_tags et
           LEFT JOIN tags t ON et.tag_id = t.id
          WHERE et.event_id = a.id) AS tags_id,

        (SELECT GROUP_CONCAT(t.title SEPARATOR '#')
           FROM events_tags et
           LEFT JOIN tags t ON et.tag_id = t.id
          WHERE et.event_id = a.id) AS tags,

        (SELECT GROUP_CONCAT(g.id SEPARATOR '#')
           FROM events_genres eg
           LEFT JOIN genres g ON eg.genre_id = g.id
          WHERE eg.event_id = a.id) AS genres_id,

        (SELECT GROUP_CONCAT(g.title SEPARATOR '#')
           FROM events_genres eg
           LEFT JOIN genres g ON eg.genre_id = g.id
          WHERE eg.event_id = a.id) AS genres,

        b.id AS user_id,
        b.username,
        b.image AS profile_image,
        a.priority,
        NULL AS liked
        
    FROM events a
    LEFT JOIN users b       ON a.user_id = b.id
    LEFT JOIN events_ages c ON a.id = c.id
    
    WHERE
        -- Deben ser eventos futuros o recientes (6h atrás)
        a.date >= DATE_SUB(NOW(), INTERVAL 6 HOUR)

        -- Solo organizadores válidos
        AND (SELECT id_org_type FROM users_org WHERE id = b.id) = 1

        -- Cursor para latest (scroll hacia atrás) o feed normal ordenado por fecha/priority/id
        AND (
            (p_is_latest = TRUE AND (id_cursor IS NULL OR a.id < id_cursor))
            OR
            (p_is_latest = FALSE AND (
                date_cursor IS NULL
                OR DATE(a.date) > date_cursor
                OR (DATE(a.date) = date_cursor AND a.priority < priority_cursor)
                OR (DATE(a.date) = date_cursor AND a.priority = priority_cursor AND a.id > id_cursor)
            ))
        )

        -- Filtro por rango de fechas
        AND (p_start_date IS NULL OR a.date >= p_start_date)
        AND (p_end_date   IS NULL OR a.date <= p_end_date)

        -- Filtro: solo eventos free?
        AND (
            p_is_free IS NULL OR p_is_free = 0
            OR (p_is_free = 1 AND a.free IS NOT NULL)
        )

        -- Filtro por géneros
        AND (p_genre_ids IS NULL OR EXISTS (
            SELECT 1 FROM events_genres eg
            WHERE eg.event_id = a.id AND FIND_IN_SET(eg.genre_id, p_genre_ids)
        ))

        -- Filtro por tags
        AND (p_tag_ids IS NULL OR EXISTS (
            SELECT 1 FROM events_tags etg
            WHERE etg.event_id = a.id AND FIND_IN_SET(etg.tag_id, p_tag_ids)
        ))

        -- Filtro por distancia
        AND (
            p_radius IS NULL OR ST_Distance_Sphere(
                a.location_cords,
                POINT(p_center_lng, p_center_lat)
            ) <= p_radius
        )

        -- Filtro por edad
        AND (
            (p_min_age IS NULL AND p_max_age IS NULL)
            OR NOT (
                   (c.max_age IS NOT NULL AND p_min_age IS NOT NULL AND c.max_age < p_min_age)
                OR (c.min_age IS NOT NULL AND p_max_age IS NOT NULL AND c.min_age > p_max_age)
            )
        )

    ORDER BY
        IF(p_is_latest = TRUE, a.created, NULL) DESC,
        IF(p_is_latest = FALSE, DATE(a.date), NULL) ASC,
        IF(p_is_latest = FALSE, a.priority, NULL) DESC,
        a.id ASC

    LIMIT 20;

END ;;
